// Wildcard match: supports patterns like '*.vercel.app' or exact hosts.
function patternMatchesHost(pattern, host) {
  pattern = pattern.trim().toLowerCase();
  host = host.toLowerCase();

  if (pattern === '*' || pattern === host) return true;

  // Normalize IPv6 brackets
  if (host.startsWith('[') && host.endsWith(']')) host = host.slice(1, -1);

  if (pattern.startsWith('*.')) {
    const suffix = pattern.slice(2); // 'vercel.app'
    return host === suffix || host.endsWith('.' + suffix);
  }
  return host === pattern;
}

function canonicalKeyHostForPattern(pattern) {
  pattern = pattern.trim().toLowerCase();
  if (pattern === '*') return '*';
  if (pattern.startsWith('*.')) return pattern.slice(2); // '*.vercel.app' -> 'vercel.app'
  return pattern; // exact host
}

const delay = ms => new Promise(r => setTimeout(r, ms));

async function sha256Bytes(text) {
  const enc = new TextEncoder().encode(text);
  const digest = await crypto.subtle.digest('SHA-256', enc);
  return new Uint8Array(digest);
}

async function xorDecodeB64WithKeyHost(b64, keyHost) {
  const raw = Uint8Array.from(atob(b64), c => c.charCodeAt(0));
  const key = await sha256Bytes(pepper + keyHost);
  const out = new Uint8Array(raw.length);
  for (let i = 0; i < raw.length; i++) out[i] = raw[i] ^ key[i % key.length];
  return new TextDecoder().decode(out);
}

function hardFail(msg) {
  console.error(msg);
  alert(msg);
  throw new Error(msg);
}

async function main() {
  const host = location.hostname;
  let matchedPattern = null;
  for (const p of allowedPatterns) {
    if (patternMatchesHost(p, host)) { matchedPattern = p; break; }
  }
  if (!matchedPattern) {
    hardFail('This build is locked to: ' + allowedPatterns.join(', ') + '\\nCurrent host: ' + host);
  }

  const keyHost = canonicalKeyHostForPattern(matchedPattern);

  const cfgB64 = ENC_CFG[keyHost];
  if (!cfgB64) hardFail('No encrypted config for matched host key: ' + keyHost);
  const cfgText = await xorDecodeB64WithKeyHost(cfgB64, keyHost);
  try {
    window.__FIREBASE_CONFIG = JSON.parse(cfgText);
  } catch (e) {
    hardFail('Failed to parse decrypted Firebase config.');
  }

  const appB64 = ENC_APP[keyHost];
  if (!appB64) hardFail('No encrypted app payload for matched host key: ' + keyHost);
  const appText = await xorDecodeB64WithKeyHost(appB64, keyHost);

  const blob = new Blob([appText], { type: 'text/javascript' });
  const url = URL.createObjectURL(blob);
  try {
    await import(url);
  } finally {
    await delay(50);
    URL.revokeObjectURL(url);
  }
}

main().catch(err => console.error('Loader failed:', err));

